import styles from './projects.module.css'

export default function Projects() {
    return (
      <div className={style.projects} >
        <h3>Projects.</h3>
        <h4>Freelance works and personal proyects.</h4>
        <div>
            <p>Slider with projects.</p>
        </div>
      </div>
    )
  }
